import React from 'react'

const DepenseCard = (props) => {
    const {id, valeur, cause, acteur} = props.depense;
    return (
       <div className="item">
           <div className="content">
                <div className="header">{valeur}</div>
                <div>{cause} par {acteur}</div>
           </div>
       </div>
    )
}

export default DepenseCard
